class Student {
  constructor(id, firstName, location) {
    this.id;
    this.firstName;
    this.location;
  }
}

export default function getListStudents() {
  const arr = [];
  arr.push(new Student(1, "Guillaume", "San Francisco"));
  arr.push(new Student(2, "James", "Columbia"));
  arr.push(new Student(5, "Serena", "San Francisco"));

  return arr;
}

